import React, { useState } from "react";

const Users = () => {
  let [users, setUser] = useState();

  return (
    <>
      <div className="users">
        <div className="header">Developer</div>

        <div className="container"></div>
        {users.map}
      </div>
    </>
  );
};

export default Users;
